Definition.WordDefinition:
midwestern \midwestern\ adj.
   Of or pertaining to the Midwest region of the U. S.,
   generally including Ohio; Indiana; Illinois; Iowa; Missouri;
   Kansas; Nebraska; and sometimes Michigan; Wisconsin;
   Minnesota; as, a midwestern city; midwestern accent.
   [WordNet 1.5]

